oxy_webhelp_navlinks = {"db_modules-d7520e35":{"topics":[{"title":" DBOS service components","shortdesc":"<p class=\"shortdesc\">DBOS component is the container for program that implements the business logic and         configuration information. The program is a set of back-end operations that  the application         runs for the user. A component offers a service to other components and in turn consumes         functions offered by other services using service-oriented interfaces.<\/p>","href":"topics\/dbos_modul.html","attributes":{"data-id":"dbos_modul"},"menu":{"hasChildren":false},"tocID":"dbos_modul-d7520e46","next":"dbos_modul-d7520e46"},{"title":"Connectors (API)","shortdesc":"<p class=\"shortdesc\">Connectors are elements for connecting composite application with other third party         applications and internal application components between each other.<\/p>","href":"topics\/connectors_module.html","attributes":{"data-id":"connectors_module"},"menu":{"hasChildren":false},"tocID":"connectors_module-d7520e812","next":"connectors_module-d7520e812"}]}};